import React, { Fragment } from "react";

export const Navigation = () => {
  return (
    <Fragment>
      <div className="nav-container">
        <div className="container">
          <header></header>

          <nav>
            <a href="OurStory.js">Our Story</a>
            <a href="#">Specials</a>
            <a href="#">Reviews</a>
            <a href="#">Contact</a>
          </nav>
        </div>
      </div>
    </Fragment>
  );
};

export default Navigation;
